(function(){tinymce.PluginManager.add("downloadmanager",function(a){a.addCommand("WP-DownloadManager-Insert_Download",function(){var b=jQuery.trim(prompt(tinymce.translate("Enter File ID (Separate Multiple IDs By A Comma)")));null!=b&&""!=b&&a.insertContent('[download id="'+b+'"]')});a.addButton("downloadmanager",{text:!1,tooltip:tinymce.translate("Insert File Download"),icon:"downloadmanager dashicons-before dashicons-download",onclick:function(){tinyMCE.activeEditor.execCommand("WP-DownloadManager-Insert_Download")}})})})();